import React from "react";
import { Router, Route, Switch } from "react-router-dom";
import Home from "./components/Home/Home";

function App() {
  return (
    <div>
      <Switch>
      <Router>
        <Route path="/" exact component={Home}/>
      </Router>
        </Switch>
    </div>
  );
}

export default App;
